Float LunaMath::Sin(Sint32 angle) {
    return s_sincosF_lookup[angle & SIN_TABLE_MASK];
}
Float LunaMath::Cos(Sint32 angle) {
    return s_sincosF_lookup[(angle + (SIN_TABLE_SIZE >> 2)) & SIN_TABLE_MASK];
}

void LunaMath::SinCos(Sint32 angle, Float *fSin, Float *fCos) {
    *fSin = LunaMath::Sin(angle);
    *fCos = LunaMath::Cos(angle);
}

Sint32 LunaMath::Atan(Sint32 dx, Sint32 dy) {
    if (dx == 0) {
        if (dy < 0) {
            return ARCTAN_POS_3;
        } else {
            return ARCTAN_POS_1;
        }
    } else if (dy == 0) {
        if (dx < 0) {
            return ARCTAN_POS_2;
        } else {
            return 0;
        }
    } else if (dx < 0) {
        dx = -dx;
        if (dy < 0) {
            dy = -dy;
            if (dx >= dy) {
                return ARCTAN_POS_2 + s_atan_lookup[(dy << ARCTAN_POS_SHIFT) / dx];
            } else {
                return ARCTAN_POS_3 - s_atan_lookup[(dx << ARCTAN_POS_SHIFT) / dy];
            }
        } else {
            if (dx >= dy) {
                return ARCTAN_POS_2 - s_atan_lookup[(dy << ARCTAN_POS_SHIFT) / dx];
            } else {
                return ARCTAN_POS_1 + s_atan_lookup[(dx << ARCTAN_POS_SHIFT) / dy];
            }
        }
    } else {
        if (dy < 0) {
            dy = -dy;
            if (dx >= dy) {
                return ARCTAN_POS_4 - s_atan_lookup[(dy << ARCTAN_POS_SHIFT) / dx];
            } else {
                return ARCTAN_POS_3 + s_atan_lookup[(dx << ARCTAN_POS_SHIFT) / dy];
            }
        } else {
            if (dx >= dy) {
                return s_atan_lookup[(dy << ARCTAN_POS_SHIFT) / dx];
            } else {
                return ARCTAN_POS_1 - s_atan_lookup[(dx << ARCTAN_POS_SHIFT) / dy];
            }
        }
    }
}
Sint32 LunaMath::Atan(Float dx, Float dy) {
    if (dx == 0) {
        if (dy < 0) {
            return ARCTAN_POS_3;
        } else {
            return ARCTAN_POS_1;
        }
    } else if (dy == 0) {
        if (dx < 0) {
            return ARCTAN_POS_2;
        } else {
            return 0;
        }
    } else if (dx < 0) {
        dx = -dx;
        if (dy < 0) {
            dy = -dy;
            if (dx >= dy) {
                return ARCTAN_POS_2 + s_atan_lookup[toI(ARCTAN_SCALE(dy) / dx)];
            } else {
                return ARCTAN_POS_3 - s_atan_lookup[toI(ARCTAN_SCALE(dx) / dy)];
            }
        } else {
            if (dx >= dy) {
                return ARCTAN_POS_2 - s_atan_lookup[toI(ARCTAN_SCALE(dy) / dx)];
            } else {
                return ARCTAN_POS_1 + s_atan_lookup[toI(ARCTAN_SCALE(dx) / dy)];
            }
        }
    } else {
        if (dy < 0) {
            dy = -dy;
            if (dx >= dy) {
                return ARCTAN_POS_4 - s_atan_lookup[toI(ARCTAN_SCALE(dy) / dx)];
            } else {
                return ARCTAN_POS_3 + s_atan_lookup[toI(ARCTAN_SCALE(dx) / dy)];
            }
        } else {
            if (dx >= dy) {
                return s_atan_lookup[toI(ARCTAN_SCALE(dy) / dx)];
            } else {
                return ARCTAN_POS_1 - s_atan_lookup[toI(ARCTAN_SCALE(dx) / dy)];
            }
        }
    }
}

void LunaMath::RotationPoint(CLunaPoint *point, Sint32 Angle) {
    Float fSin = LunaMath::Sin(Angle);
    Float fCos = LunaMath::Cos(Angle);
    float x = (point->Px * fCos) - (point->Py * fSin);
    float y = (point->Px * fSin) + (point->Py * fCos);
    point->Px = x;
    point->Py = y;
}

